import React from 'react';
import './ExRoutes.css';

export default function ExRoutes() {
    return (
        <>
            <div className='ex-routes-container'>
                <div className='route'>
                    <table>
                        <thead>
                            <tr>
                                <th>Tratta</th>
                                <th>Mezzo</th>
                                <th>Costo</th>
                            </tr>
                        </thead>
                        <tbody>
                            <tr>
                                <td>Milano - Roma</td>
                            </tr>
                        </tbody>
                    </table>
                </div>
            </div>
        </>
    );
};
